const SnakeGame = () => {
    return (
        <div className="snakegame">
            <h1>snake game</h1>
            <div className="game-area">
                <div className="snake-dot" style={{top:0, left:0}}></div>
                <div className="snake-dot" style={{top:'', left:0}}></div>
            </div>
        </div>
    );
}

export default SnakeGame;
